css:
.highlight.linter-warning .region {
  background: linear-gradient(to bottom, #f1c40f 0%, rgba(241, 196, 15, 0.30000000000000004) 20%, rgba(241, 196, 15, 0.30000000000000004) 80%, #f1c40f 100%);
  border-left: 2px solid #f1c40f;
  border-right: 2px solid #f1c40f;
}
.highlight.linter-error .region {
  background: linear-gradient(to bottom, #e74c3c 0%, rgba(231, 76, 60, 0.30000000000000004) 20%, rgba(231, 76, 60, 0.30000000000000004) 80%, #e74c3c 100%);
  border-left: 2px solid #e74c3c;
  border-right: 2px solid #e74c3c;
}
